        ///播放音频相关   
        function myPlay(mybase64) {
            //console.log(mybase64);
            if (mybase64) {
                const audioContext = new AudioContext();
                // 创建AudioContext对象  

                // 将Base64字符串转换为ArrayBuffer  
                const arrayBuffer = base64ToArrayBuffer(mybase64);

                audioContext.decodeAudioData(arrayBuffer)// 解码音频数据  
                    .then(audioBuffer => {
                        // 创建音频缓冲区对象  
                        const source = audioContext.createBufferSource();
                        // 创建音频源对象  
                        source.buffer = audioBuffer;
                        // 将音频缓冲区对象赋值给音频源对象的buffer属性  
                        source.connect(audioContext.destination);
                        // 将音频源对象连接到音频上下文的输出节点  
                        source.start();
                        // 开始播放音频源对象  
                    }
                    ).catch(error => {
                        // 捕获解码音频数据失败的错误并输出错误信息到控制台  
                        console.error('解码音频数据失败：', error);
                    }
                    );
            } else {

                alert('Base64声音数据为空！');
                // alert('请先上传文件并获取Base64编码结果！');
                // 提示用户先上传文件并获取Base64编码结果后再尝试播放声音  
            }
        }

        // 将Base64字符串转换为ArrayBuffer的函数  
        function base64ToArrayBuffer(base64) {
            const raw = window.atob(base64);
            // 将Base64字符串解码为二进制数据  
            const rawLength = raw.length;
            // 获取二进制数据的长度  
            const arr = new Uint8Array(new ArrayBuffer(rawLength));
            // 创建一个与二进制数据长度相等的Uint8Array数组  
            for (let i = 0; i < rawLength; i++) {
                // 将每个字符转换为对应的字节并存储在Uint8Array数组中  
                arr[i] = raw.charCodeAt(i);
            }
            return arr.buffer;
            // 返回转换后的ArrayBuffer对象  
        }


