        /***********get图片begin */

        // 定义请求的URL  
        const url = "https://www.deskpro.cn/file/filemanage/downloadFileById/70ec184b756745bbaeb883af7df0d997.png";

        // 定义请求头  
        const headers = {
            "accept": "image/avif,image/webp,image/apng,image/svg+xml,image/*,*/*;q=0.8",
            "accept-language": "zh-CN,zh;q=0.9",
            "sec-ch-ua": "\"Not.A/Brand\";v=\"8\", \"Chromium\";v=\"114\"",
            "sec-ch-ua-mobile": "?0",
            "sec-ch-ua-platform": "\"Windows\"",
            "sec-fetch-dest": "image",
            "sec-fetch-mode": "no-cors",
            "sec-fetch-site": "same-origin"
        };

        // 定义请求参数  
        const requestParams = {
            referrer: "https://www.deskpro.cn/",
            referrerPolicy: "no-referrer-when-downgrade",
            method: "GET",
            mode: "cors",
            credentials: "include"
        };



        // 发送请求的函数  
        function sendRequestImg() {
            let startTime = Date.now();
            fetch(url, {
                headers: headers,
                ...requestParams
            })
                .then(response => {
                    //console.log('Response status:', response.status); // 打印响应状态码  
                    // 根据你的需求，可以进一步处理响应数据
                    // 在图片加载完成后，记录下当前时间（结束时间）  
                    let endTime = Date.now();
                    // 计算请求时间（毫秒）  
                    let requestTime = endTime - startTime;
                    // 计算网速（Mbps）
                    let imageSize = 3.85;//字节  
                    let speed = (imageSize / 8) / (requestTime / 1000) / 8;

                    speed = speed.toFixed(2) + 'M';
                    //console.log('sudu',speed);
                    // 打印网速结果  
                    //console.log('Speed: ', speed.toFixed(2) + 'Mbps');
                    let myLi3 = document.querySelector('#myLi3');
                    if (response.status == 200) {
                        if (myLi3.style.color == 'red') {
                            myLi3.style.color = 'black';

                        }
                        myLi3.textContent = speed;
                        //console.log('图片请求成功', response.status);
                    } else {
                        myLi3.style.color = 'red';
                        myLi3.textContent = response.status;
                        myPlay(mybase64_err);
                        console.log('图片请求失败', response.status);
                    }
                })
                .catch(error => {
                    myPlay(mybase64_err);
                    console.error('Error:', error); // 打印错误信息  
                });
        }


